import React from 'react'
import Video  from "./Video";
const VideoGrid = () => {
    const images = [1,3,5,7];

    return (
        <div className="ml-2 mr-2">

            {images.map(img => (
                <div className="d-flex mb-2">
                    <Video key={img} video={img} big={true} image={require(`../../images/music/${img}.jpg`)} />
                    <Video key={img+1} video={img+1} big={false} image={require(`../../images/music/${img+1}.jpg`)} />
                </div>
            ))}

        </div>
    )
}

export default VideoGrid
